import '../Assets/CSS/header.css'
import { NavLink } from 'react-router-dom';
import React, { useEffect, useState } from 'react';

const Header = () =>{
    const [isActive, setIsActive] = useState(false);

    useEffect(() => {
        setTimeout(() => {
            setIsActive(true);
        }, 2250);
    }, []);
    return(
        <>
            <nav className={`navbar ${isActive ? 'active' : ''}`}>
                
                <div className="navbar-logo"><NavLink to="/"><img src="./UTM.webp" alt="UTM" id='UTM'></img></NavLink></div>
                <div className='options'>
                    <NavLink to="/" activeclassname="active">
                        <img className="navbar-icon" src="./icons/home.webp" alt="inicio" />
                    </NavLink>
                    <NavLink to="/diseños" activeclassname="active">
                        <img className="navbar-icon" src="./icons/diseño.webp" alt="diseños" />
                    </NavLink>
                    <NavLink to="/contacto" activeclassname="active">
                        <img className="navbar-icon" src="./icons/contacto.webp" alt="contacto" />
                    </NavLink>
                    <NavLink to="/carrito" activeclassname="active">
                        <img className="navbar-icon" src="./icons/carrito.webp" alt="carrito" />
                    </NavLink>
                </div>
            </nav>
        </> 
    )
}

export default Header
